import { Component, OnInit } from '@angular/core';

import { Message } from 'primeng/api';
import * as jsPDF from 'jspdf';
//https://github.com/yamadapc/js-written-number
import * as writtenNumber from 'written-number';

import { Company, Invoice } from "../../models";
import { CompanyService, InvoiceService } from "../../services";
import { Configuration } from '../../app.configuration';

@Component({
	selector: 'app-invoice',
	templateUrl: './invoice.component.html',
	styleUrls: ['./invoice.component.css'],
	providers: [CompanyService, InvoiceService]
})
export class InvoiceComponent implements OnInit {
	es: any;
	maxDate: Date;
	msgs: Message[] = [];

	companys: Company[] = [];
	selectedCompany: Company = {};

	rangeDates: Date[];
	factura: number;

	showInvoices: boolean = false;
	invoices: Invoice[] = [];
	selectedInvoice: Invoice = {};
	expanded: boolean = false;

	constructor(private _srvComp: CompanyService, private _srvInvo: InvoiceService) {
		this.maxDate = new Date(Date.now());
		this.es = {
			firstDayOfWeek: 1,
			dayNames: ["Domingo", "Lunes", "Martes", "Miércoles", "Jueves", "Viernes", "sábado"],
			dayNamesShort: ["Dom", "Lun", "Mar", "Mié", "Jue", "Vie", "Sáb"],
			dayNamesMin: ["D", "L", "M", "X", "J", "V", "S"],
			monthNames: ["Enero", "Febrero", "Marzo", "Abril", "Mayo", "Junio", "Julio", "Agosto", "Septiembre", "Octubre", "Noviembre", "Diciembre"],
			monthNamesShort: ["Ene", "Feb", "Mar", "Abr", "May", "Jun", "Jul", "Ago", "Sep", "Oct", "Nov", "Dic"],
			today: 'Hoy',
			clear: 'Borrar'
		}
	}

	descomponer

	ngOnInit() {

		/*
	    
		writtenNumber.defaults.lang = "es";
	
		let o = writtenNumber(101001).toUpperCase().split(" ");
		console.log(o.length);
		if(o.length>0 && o[o.length - 1]=="UN"){
		  o[o.length - 1]= "UNO";
		}
		console.log(o);
		*/



		this._srvComp.getCompanys("adm").subscribe(data => { this.getCompanysCatalog(data); }, error => { console.log(error); });
	}

	getCompanysCatalog(data) {
		this.msgs = [];
		if (!data) {
			this.msgs.push({ severity: 'error', summary: 'ERROR', detail: 'No hay empresas que mostrar' });
			return;
		}
		this.companys = data;
	}

	getInvoices(event) {
		this.msgs = [];
		this.showInvoices = false;
		if (!this.selectedCompany || Configuration.isEmpty(this.selectedCompany)) {
			this.msgs.push({ severity: 'error', summary: 'ERROR', detail: 'Debe seleccionar una empresa' });
			return;
		} else {
			if (this.factura) {
				this._srvInvo.getInvoicesById(this.selectedCompany.base_de_datos, this.factura).subscribe(data => { this.getInvoicesData(data); }, error => { console.log(error); });
			} else {
				var since = "";
				var until = "";
				if (this.rangeDates && (this.rangeDates.length >= 1 || this.rangeDates.length <= 2)) {
					since = this.rangeDates[0].getFullYear() + '-' + (this.rangeDates[0].getMonth() + 1) + '-' + this.rangeDates[0].getDate();
					if (this.rangeDates[1] == null || Configuration.isEmpty(this.rangeDates[1])) {
						until = since;
					} else {
						until = this.rangeDates[1].getFullYear() + '-' + (this.rangeDates[1].getMonth() + 1) + '-' + this.rangeDates[1].getDate();
					}
					this._srvInvo.getInvoicesByDate(this.selectedCompany.base_de_datos, since, until).subscribe(data => { this.getInvoicesData(data); }, error => { console.log(error); });
				} else {
					//this.msgs.push({severity:'error', summary:'ERROR', detail:'Debe indicar algun filtro'});
					//return;          
					this._srvInvo.getInvoices(this.selectedCompany.base_de_datos).subscribe(data => { this.getInvoicesData(data); }, error => { console.log(error); });
				}
			}
		}
	}

	getInvoicesData(data) {

		//console.log(data);
		//console.log(data.length);

		this.msgs = [];
		if (!data || data.length < 1) {
			this.msgs.push({ severity: 'info', summary: 'Resultado', detail: 'No se encontro información con esos filtros' });
			return;
		}
		this.invoices = data;
		this.showInvoices = true;
	}

	printInvoice(data: Invoice) {
		if (this.selectedCompany.tipo_factura == "Formato") {
			//alert('La representacion del formato PDF de esta factura esta en construccion');
			this.defineFormatInvoice(data);
		} else if (this.selectedCompany.tipo_factura == "Forma libre") {
			this.freeFormatIvoice(data);
		}
	}

	private freeFormatIvoice(data: Invoice) {
		var doc = new jsPDF();


		doc.setProperties({
			orientation: 'portrait',
			unit: 'mm',
			format: 'letter',
			title: 'Factura_' + this.selectedCompany.cod_empresa + '_' + data.num_factura,
			subject: data.cli_nombre,
			author: this.selectedCompany.nombre_empresa,
			creator: this.selectedCompany.nombre_empresa
		});


		var y: number = 50;

		if (this.selectedCompany.cod_empresa == 8) {
			y = y + 10;
		}
		//LINEA 1
		doc.setFont("courier");
		doc.setFontSize(16);
		doc.setFontStyle("bold");

		doc.text(60, y, 'Nº FACTURA: ' + data.num_factura);


		if (this.selectedCompany.cod_empresa == 8) {
			doc.setFontSize(10);
		} else {
			doc.setFontSize(11);
		}
		doc.setFontStyle("bold");
		var fecha = "";
		if (data.fecha_emision) {
			fecha = data.fecha_emision.substring(8, 10) + "/" + data.fecha_emision.substring(5, 7) + '/' + data.fecha_emision.substring(0, 4)
		}

		//doc.text(160, y, 'FECHA: ' + fecha);
		if (this.selectedCompany.cod_empresa == 8) {
			doc.text(170, 19, fecha);
		} else {
			doc.text(160, y, 'FECHA: ' + fecha);
		}

		//Separador
		doc.line(0, y + 2, 210, y + 2);
		var vertY = y + 2;

		//LINEA 2
		y = y + 6;
		doc.setFontStyle("bold");
		doc.text(10, y, 'CLIENTE:');
		doc.setFontStyle("bold");
		doc.text(35, y, data.cli_nombre);


		//LINEA 3
		y = y + 6;
		doc.setFontStyle("bold");
		doc.text(5, y, 'DIRECCION:');
		doc.setFontStyle("normal");
		var splitTitle = doc.splitTextToSize(data.cli_direccion, 170);
		doc.text(35, y, splitTitle);

		//LINEA 4
		y = y + (splitTitle.length * 5);
		doc.setFontStyle("bold");
		doc.text(18, y, 'RIF:');
		doc.setFontStyle("normal");
		doc.text(35, y, data.cli_rif_cedula);
		doc.setFontStyle("bold");
		doc.text(75, y, 'TELEFONOS:');
		doc.setFontStyle("normal");
		doc.text(100, y, data.cli_telefono);

		//Separador
		doc.line(32, vertY, 32, y + 2);
		doc.line(0, y + 2, 210, y + 2);

		//LINEA 5
		y = y + 6;
		doc.setFontStyle("bold");
		doc.text(135, y, 'FORMA DE PAGO:');
		doc.setFontStyle("normal");
		doc.text(170, y, data.pago);

		//Separador
		doc.line(0, y + 2, 210, y + 2);

		//LINEA 6
		y = y + 6;
		doc.setFontStyle("bold");
		doc.text(2, y, 'RENG');
		doc.text(14, y, 'CANTIDAD');
		doc.text(35, y, 'UND');
		doc.text(45, y, 'DESCRIPCION');
		doc.text(140, y, 'PRECIO UNITARIO');
		doc.text(180, y, 'TOTAL');

		//Separador
		doc.line(0, y + 2, 210, y + 2);

		//LINEA 7
		y = y + 6;
		for (let renglon of data.detalle) {
			doc.setFontStyle("normal");
			doc.text(2, y, renglon.renglon);
			doc.text(14, y, Configuration.numberFormat(renglon.cantidad));
			doc.text(35, y, renglon.unidad);
			if (renglon.descripcion_larga && renglon.descripcion_larga.length > 0) {
				var splitTitle = doc.splitTextToSize(renglon.descripcion_larga, 90);
				doc.text(45, y, splitTitle);
			} else {
				doc.text(45, y, renglon.descripcion);
			}
			doc.text(140, y, Configuration.numberFormat(renglon.precio));
			var impuesto = "E";
			//if(Configuration.numberFormat(renglon.iva) > 0) {
			if (renglon.aplica_iva == "Si") {
				impuesto = "G";
			}
			doc.text(180, y, Configuration.numberFormat(renglon.total) + " " + impuesto);
			y = y + (splitTitle.length * 4);
		}

		//Separador
		y = 250;
		if (this.selectedCompany.cod_empresa == 8) {
			y = 233;
		}
		doc.line(0, y, 210, y);

		//LINEA 8
		y = y + 6;
		doc.setFontSize(12);
		doc.setFontStyle("bold");
		if (this.selectedCompany.cod_empresa == 8) {
			doc.text(30, y, 'GRAVADO:');
			doc.text(55, y, Configuration.numberFormat(data.tot_gravado));
		} else {
			doc.text(40, y, 'GRAVADO:');
			doc.text(65, y, Configuration.numberFormat(data.tot_gravado));
		}

		doc.text(100, y, 'DESCUENTO:');
		doc.text(130, y, Configuration.numberFormat(data.descto));
		//LINEA 9
		y = y + 4;
		doc.setFontStyle("bold");
		if (this.selectedCompany.cod_empresa == 8) {
			doc.text(30, y, 'EXENTO:');
			doc.text(55, y, Configuration.numberFormat(data.tot_exento));
		} else {
			doc.text(40, y, 'EXENTO:');
			doc.text(65, y, Configuration.numberFormat(data.tot_exento));
		}


		doc.text(100, y, 'I.V.A. (' + Configuration.numberFormat(data.ivap) + '%):');
		doc.text(145, y, Configuration.numberFormat(data.iva));

		//LINEA 10
		y = y + 4;
		doc.setFontStyle("bold");
		if (this.selectedCompany.cod_empresa == 8) {
			doc.text(30, y, 'SUB-TOTAL:');
			doc.text(60, y, Configuration.numberFormat(parseFloat(data.tot_gravado) + parseFloat(data.tot_exento)));
		} else {
			doc.text(40, y, 'SUB-TOTAL:');
			doc.text(70, y, Configuration.numberFormat(parseFloat(data.tot_gravado) + parseFloat(data.tot_exento)));
		}

		doc.text(100, y, 'TOTAL GENERAL:');
		doc.text(140, y, Configuration.numberFormat(data.tot_neto));

		//LINEA 11
		y = y + 6;
		doc.setFontSize(11);
		writtenNumber.defaults.lang = 'es';
		var integerPart = data.tot_neto.substring(0, data.tot_neto.indexOf("."));
		var decimalPart = data.tot_neto.substring(data.tot_neto.indexOf(".") + 1, data.tot_neto.length);


		let numeroEnteroLetras = writtenNumber(integerPart).toUpperCase().split(" ");

		if (numeroEnteroLetras.length > 0 && numeroEnteroLetras[numeroEnteroLetras.length - 1] == "UN") {
			numeroEnteroLetras[numeroEnteroLetras.length - 1] = "UNO";
		}

		//var allNumber =  writtenNumber(integerPart).toUpperCase() + " BOLIVARES";

		var allNumber = numeroEnteroLetras + " BOLIVARES";

		if (decimalPart) {
			allNumber += " CON " + writtenNumber(decimalPart).toUpperCase() + " CTMOS";
		} else {
			allNumber += " CON CERO CTMOS";
		}

		allNumber = (allNumber.length > 40 ? doc.splitTextToSize(allNumber, 180) : allNumber);

		doc.setFontStyle("bold");

		if (this.selectedCompany.cod_empresa == 8) {
			doc.text(7, y, 'Son:');
			doc.setFontStyle("normal");
			doc.text(18, y, allNumber);
		} else {
			doc.text(12, y, 'Son:');
			doc.setFontStyle("normal");
			doc.text(22, y, allNumber);
		}
		var blob = doc.output("blob");
		window.open(URL.createObjectURL(blob));
	}

	private defineFormatInvoice(data: Invoice) {
		var pageWith = 210;
		var pageHeight = 279.4;
		var middleWith = pageWith / 2;
		var middleHeight = pageHeight / 2;

		let desviacion_y: number = 28;


		if ((this.selectedCompany.cod_empresa == 2) || (this.selectedCompany.cod_empresa == 1)) {
			desviacion_y = 32;
		}

		var doc = new jsPDF();
		doc.setProperties({
			orientation: 'portrait',
			unit: 'mm',
			format: [pageWith, pageHeight],//'letter',
			title: 'Factura_' + this.selectedCompany.cod_empresa + '_' + data.num_factura,
			subject: data.cli_nombre,
			author: this.selectedCompany.nombre_empresa,
			creator: this.selectedCompany.nombre_empresa
		});


		if (!Configuration.isProduction) {
			//se inserta fondo de la factura para ajustar posicion de las cosas
			var imgData = "data:image/jpeg;base64,";
			doc.addImage(imgData, 'JPEG', 0, 0, pageWith, pageHeight);
		}

		var y: number = 48;
		doc.setFont("helvetica");

		//LINEA 1
		doc.setFontSize(8);
		doc.setFontStyle("bold");
		doc.text(143, y, 'Puerto Ordaz');
		doc.text(168, y, data.fecha_emision.substring(8, 10));
		doc.text(178, y, data.fecha_emision.substring(5, 7));
		doc.text(188, y, data.fecha_emision.substring(0, 4));
		doc.text(40, y + 10, this.selectedCompany.rif);

		//LINEA 2
		y = y + 19;
		doc.setFontSize(9);
		doc.setFontStyle("bold");
		doc.text(51, y, data.cli_nombre);
		doc.setFontStyle("normal");
		doc.text(170, y - 1, data.cli_rif_cedula);

		//LINEA 3

		var zz: number = y + 6;
		y = y + 5;
		doc.setFontSize(6);
		doc.setFontStyle("normal");



		var splitTitle = doc.splitTextToSize(data.cli_direccion, 165);

		doc.text(36, y, splitTitle);

		y = zz;

		//LINEA 4
		y = y + 7;
		doc.setFontSize(9);
		doc.setFontStyle("normal");
		doc.text(92, y, data.cli_telefono);
		doc.text(170, y, data.pago);

		//LINEA 5
		y = y + 18;
		doc.setFontSize(9);
		for (let renglon of data.detalle) {
			doc.setFontStyle("normal");
			if (renglon.descripcion_larga && renglon.descripcion_larga.length > 0) {
				var splitRenglon = doc.splitTextToSize(renglon.descripcion_larga, 104);
				doc.text(38, y, splitRenglon);
			} else {
				doc.text(38, y, renglon.descripcion);
			}
			//doc.text(pageWith-28, y, Configuration.numberFormat(renglon.precio), {align: 'left'});
			doc.text(pageWith - desviacion_y, y, Configuration.numberFormat(renglon.precio), { align: 'left' });
			var cantLines = 1;
			if (splitRenglon) {
				cantLines = splitRenglon.length
			}
			y = y + (cantLines * 4);
		}

		//LINEA 6
		y = y + 14;
		writtenNumber.defaults.lang = 'es';
		var integerPart = data.tot_neto.substring(0, data.tot_neto.indexOf("."));
		var decimalPart = data.tot_neto.substring(data.tot_neto.indexOf(".") + 1, data.tot_neto.length);
		var allNumber = writtenNumber(integerPart).toUpperCase() + " BOLIVARES";
		if (decimalPart) {
			allNumber += " CON " + writtenNumber(decimalPart).toUpperCase() + " CTMOS";
		} else {
			allNumber += " CON CERO CTMOS";
		}
		doc.setFontStyle("normal");
		var splitRenglon = doc.splitTextToSize(allNumber, 104);
		doc.text(38, y, splitRenglon);

		//LINEA 7
		y = 231.5;
		doc.setFontStyle("bold");
		//doc.text(pageWith-28, y, Configuration.numberFormat(data.tot_bruto), {align: 'left'});
		doc.text(pageWith - desviacion_y, y, Configuration.numberFormat(data.tot_bruto), { align: 'left' });

		//LINEA 8
		y = y + 7.5;
		doc.setFontStyle("bold");
		doc.text(98, y, Configuration.numberFormat(data.ivap));
		//doc.text(pageWith-28, y-1, Configuration.numberFormat(data.iva), {align: 'left'});
		doc.text(pageWith - desviacion_y, y - 1, Configuration.numberFormat(data.iva), { align: 'left' });

		//LINEA 7
		y = y + 12.5;
		doc.setFontStyle("bold");
		//doc.text(pageWith-28, y, Configuration.numberFormat(data.tot_neto), {align: 'left'});
		doc.text(pageWith - desviacion_y, y, Configuration.numberFormat(data.tot_neto), { align: 'left' });

		var blob = doc.output("blob");
		window.open(URL.createObjectURL(blob));
	}
}
